          padding: 20px;
          background-color: orange;
        }
        .logo {
          font-size: 3vh;
        }
        .wrapper {
          border-bottom: 1px solid black;
        }
        nav {
          display: flex;
          align-items: center;
        }
        .spacer {
          flex: 1;
        }
      `}</style>
    </div>
  );
};

export default Header;
